import { useNavigate } from 'react-router-dom';

const Carousel = () => {
    const navigate = useNavigate();

    const handleBrandClick = (brand) => {
        navigate(`/shop/brand/${brand}`);
    };

    return (
        <div className='carousel'>
            <div className="logos">
                <img src={animonda} alt="Animonda" onClick={() => handleBrandClick('Animonda')} />
                <img src={bioline} alt="Bioline" onClick={() => handleBrandClick('Bioline')} />
                <img src={classic_pets} alt="Classic Pets" onClick={() => handleBrandClick('Classic Pets')} />
                <img src={petkin} alt="Petkin" onClick={() => handleBrandClick('Petkin')} />
                <img src={meo} alt="Meo" onClick={() => handleBrandClick('Meo')} />
                <img src={arm_hammer} alt="Arm & Hammer" onClick={() => handleBrandClick('Arm & Hammer')} />
                <img src={equilibrio} alt="Equilibrio" onClick={() => handleBrandClick('Equilibrio')} />
                <img src={spot} alt="Spot" onClick={() => handleBrandClick('Spot')} />
            </div>
        </div>
    );
};

export default Carousel;
